    image: process.env.PUBLIC_URL + '/images/Pesarattu.jpeg'
  }
];

const Home = () => {
  const navigate = useNavigate();
  const { addToCart } = useCart();
  const [message, setMessage] = React.useState('');

  const handleAddToCart = (item) => {
    addToCart(item);
    setMessage(`${item.name} added to cart`);
    setTimeout(() => setMessage(''), 2000);
  };

  const formatPriceINR = (price) => {
    return price.toLocaleString('en-IN', { style: 'currency', currency: 'INR' });
  };

  return (
    <div
      className="main-content"
      style={{
        maxWidth: '100%',
        margin: '0 auto',
        backgroundColor: '#fff',
        padding: '40px 60px',
        borderRadius: '12px',
        minHeight: '100vh',
        boxSizing: 'border-box',
      }}
    >
      <h1 style={{ color: '#d32f2f', fontWeight: '700', marginBottom: '30px', textAlign: 'center' }}>Food Suggestions</h1>
      {message && <div className="add-cart-message">{message}</div>}
      <div
        className="food-gallery"
        style={{
          display: 'grid',
          gridTemplateColumns: 'repeat(auto-fill, minmax(300px, 1fr))',
          gap: '2rem',
          justifyItems: 'center',
        }}
      >
        {foodItems.map((item) => (
          <div
            key={item.id}
            className="food-item"
            style={{
              backgroundColor: 'white',
              borderRadius: '8px',
              padding: '1rem',
              textAlign: 'center',
              boxShadow: '0 2px 5px rgba(0,0,0,0.1)',
              transition: 'transform 0.2s ease, box-shadow 0.2s ease',
              width: '300px',
            }}
          >
            <img
              src={item.image}
              alt={item.name}
              style={{ width: '100%', height: '240px', objectFit: 'cover', borderRadius: '6px', marginBottom: '0.5rem' }}
              onError={(e) => {
                e.target.style.display = 'none';
              }}
            />
            <div className="food-name" style={{ fontWeight: '600', marginBottom: '0.5rem', color: '#333' }}>
              {item.name}
            </div>
            <div className="food-price" style={{ fontWeight: '600', color: '#d32f2f', marginBottom: '0.5rem' }}>
              ₹{item.price.toLocaleString('en-IN', { style: 'currency', currency: 'INR' })}
            </div>
            <button
              onClick={() => handleAddToCart(item)}
              className="btn-add-cart"
              style={{
                backgroundColor: '#d32f2f',
                color: 'white',
                border: 'none',
                padding: '0.4rem 0.8rem',
                borderRadius: '4px',
                cursor: 'pointer',
                fontWeight: '600',
                transition: 'background-color 0.3s ease',
              }}
            >
              Add to Cart
            </button>
          </div>
        ))}
      </div>
      <section className="review-section" style={{ marginTop: '40px', width: '100%', minHeight: '100vh' }}>
        <Review />
      </section>
    </div>
  );
};

export default Home;
